// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

//Registring a vehicle


contract v2v{

address public TA;
//============= TA Registration
constructor() {
        TA = msg.sender;
    }

modifier onlyTA() {
        require(msg.sender == TA, "Only authorized to TA");
        _;
    }


struct EV{
    uint256 ID;
    address uAdd;
    uint256 pKey; //Address or public key
    string certi; 
    uint256 NC; //Network Code
    uint256 T_exp;//Expiry time
    bool status; //Status of certificate
}

mapping(address=>EV) public Evs;
uint256 public evCount;

    //EVs Registration
    function registerEV(uint256 _ID,address _uAdd, uint256 _pKey, string memory _certi, uint256 _NC, uint256 _T_exp, bool _status) public{
        Evs[_uAdd]=EV(_ID,_uAdd, _pKey,_certi, _NC, _T_exp,_status);
        evCount++;
    }


struct RSU{
    uint256 ID;
    address uAdd;
    uint256 pKey; //Address or public key
    string certi; 
    string h_rps;//response hash of PUF
    string C_t; //Challenege
    uint256 T_exp;//Expiry time
    bool status; //Status of certificate
}

//===== RSU
mapping(address=>RSU) public Rsu;
uint256 public rsuCount; //To count the total number of rsus


//============= RSU
uint rsuId;

function registerRSU(uint256 _ID,address _uAdd, uint256 _pKey, string memory _certi, string memory _h_rps, string memory _C_t, uint256 _T_exp, bool _status) public{
        Rsu[_uAdd]=RSU(_ID,_uAdd, _pKey,_certi, _h_rps, _C_t, _T_exp,_status);
        rsuCount++;
    }

// //Checking Registration
function checkRegistration(address _Add, uint _type) view public returns(bool){
        if(_type==0){
            return Evs[_Add].status;
        }else{
            return Rsu[_Add].status;
        }
}


//=============== Certificate Revocation [ _type indicates EV or RSU]
function revocationCerti(address _Add, uint _type) public onlyTA(){
        if(_type==0){
            Evs[_Add].status=false;
        }else{
            Rsu[_Add].status=false;
        }
}



} //End of contract
